const dinos = [
    {
        type: "T-Rex",
        name: "Bob",
        image: "data:image/jpeg;base64,"
    },
    {
        type: "Triceratops",
        name: "Steve",
        image: "data:image/jpeg;base64,"
    },
    {
        type: "Pterodactyl",
        name: "John",
        image: "data:image/jpeg;base64,"
    },
    {
        type: "Raptor",
        name: "George",
        image: "data:image/jpeg;base64,"
    }
];

const printToDOM = (Id, string) => {
    const selectedDiv = document.getElementById(Id);
    selectedDiv.innerHTML = string;
}

const printDinos = () => {
    let domString = "";
    for (let i = 0; i < dinos.length; i++) {
        domString += `<div class="card">
        <img src="${dinos[i].image}" alt="${dinos[i].name}" style="width:75%">
        <div class="container">
          <h4><b>${dinos[i].name}</b></h4>
          <p>${dinos[i].type}</p>
        </div>
      </div>`;
    }
    printToDOM("target", domString);
}

printDinos();
